function Project(props) {

    const url = props.url;
    // console.log(props);
    return (
        <div className='project'>
            {/* <img src={props.image} alt={props.alt} /> */}
            <img src="calculator-image.jpg" alt="white-origami" />
            <div id='project-info'>
                <p>{props.name}</p>
                <p>{props.description}</p>
                <a href={url}>{props.url} </a>
            </div>
        </div>
    );
}

export default Project;
